import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div style={{width: 1440, height: 76, background: '#005BAC'}} />
      <div style={{width: 46, height: 11, background: 'rgba(0, 175, 236, 0.70)'}} />
      <div style={{width: 59, height: 11, background: 'rgba(248, 182, 43, 0.70)'}} />
      <div style={{textAlign: 'center'}}><span style={{color: 'black', fontSize: 17, fontFamily: 'Pretendard', fontWeight: '500', lineHeight: 27.20, wordWrap: 'break-word'}}>프로젝트를 함께 진행할 개발자 / 디자이너를<br/></span><span style={{color: 'black', fontSize: 17, fontFamily: 'Pretendard', fontWeight: '700', lineHeight: 27.20, wordWrap: 'break-word'}}>mogu</span><span style={{color: 'black', fontSize: 17, fontFamily: 'Pretendard', fontWeight: '500', lineHeight: 27.20, wordWrap: 'break-word'}}>와 함께 모집하고 구해보세요!</span></div>
      <div style={{textAlign: 'center'}}><span style={{color: 'black', fontSize: 17, fontFamily: 'Pretendard', fontWeight: '500', lineHeight: 27.20, wordWrap: 'break-word'}}>인하대학교 소속 IVC 스타트업 팀 </span><span style={{color: 'black', fontSize: 17, fontFamily: 'Pretendard', fontWeight: '700', lineHeight: 27.20, wordWrap: 'break-word'}}>mogu</span><span style={{color: 'black', fontSize: 17, fontFamily: 'Pretendard', fontWeight: '500', lineHeight: 27.20, wordWrap: 'break-word'}}>입니다.</span></div>
      <div style={{width: 345, textAlign: 'center', color: 'rgba(0, 0, 0, 0.50)', fontSize: 11, fontFamily: 'Pretendard', fontWeight: '500', lineHeight: 17.60, wordWrap: 'break-word'}}>참여 정보는 저희 프로젝트를 발전시키기 위한 자료로 <br/>쓰일 수 있음을 알려드립니다.</div>
      <div style={{color: 'white', fontSize: 34, fontFamily: 'Pretendard', fontWeight: '700', wordWrap: 'break-word'}}>mogu</div>
      <div style={{width: 1440, height: 279, background: 'linear-gradient(180deg, rgba(255, 255, 255, 0) 0%, rgba(255, 255, 255, 0.70) 55%, rgba(255, 255, 255, 0.90) 76%, white 100%)'}}>
        <img src="your-image-url.jpg" alt="Description" style={{ 
        width: '100%', 
        height: '100%', 
        objectFit: 'cover', 
        position: 'absolute',
        top: 0,
        left: 0
        }} />
      </div>
    </div>
  );
}

export default App;
